import React from "react";
import Common from "./common";
import Img from "../src/images/Img.png"


const Home = () => {
    return (
        <>
           <Common
            name = "Grow your business with"
            imgsrc = {Img}
            visit = "/service"
            btn_name = "get started"
           />
        </>
    )
}

export default Home;
